style.css:
/* Seleciona o logo do Roblox na página inicial */
a[aria-label="Home"] svg {
    animation: rotate 3s infinite linear, rgbShift 2s infinite;
}

/* Animação de rotação contínua */
@keyframes rotate {
    from {
        transform: rotate(0deg);
    }
    to {
        transform: rotate(360deg);
    }
}

/* Animação para efeito RGB */
@keyframes rgbShift {
    0% {
        filter: hue-rotate(0deg);
    }
    50% {
        filter: hue-rotate(180deg);
    }
    100% {
        filter: hue-rotate(360deg);
    }
}
